export default function putInfoToDB(t,e){let o=localStorage.getItem("token");return fetch("https://ajax.test-danit.com/api/cards/"+t,{method:"PUT",body:JSON.stringify(e),headers:{Authorization:"Bearer "+o,"Content-Type":"application/json;charset=utf-8"}}).then(t=>t.text()).catch(t=>{console.log("message of Put request: ",t.message)})}